import React from "react";
import "./CompaniesSection.css";

// Sample company logos — replace with actual image paths or URLs
const companyLogos = [
  { name: "Koochi Poochi", src: "/images/koochi.png" },
  { name: "Sreeleathers", src: "/images/sreeleathers.png" },
  { name: "Thr3Letter", src: "/images/thr3letter.png" },
  { name: "Quniaa", src: "/images/quniaa.png" },
  { name: "Stile Adda", src: "/images/stileadda.png" },
  { name: "Carrydreams", src: "/images/carrydreams.png" },
  { name: "COMMN SENS", src: "/images/commnsens.png" },
  { name: "KALALOM", src: "/images/kalalom.png" },
  { name: "DENNISON", src: "/images/dennison.png" },
  { name: "Sosuya", src: "/images/sosuya.png" },
  { name: "British Trolley", src: "/images/britishtrolley.png" },
  { name: "Natraj Jewellers", src: "/images/natrajjewellers.png" },
];

const CompaniesSection = () => {
  return (
    <section className="companies-section">
      <h2>People we've trained work at</h2>
      <div className="company-logos">
        {companyLogos.map((company, index) => (
          <div className="logo-container" key={index}>
            <img src={company.src} alt={company.name} title={company.name} />
          </div>
        ))}
      </div>
    </section>
  );
};

export default CompaniesSection;
